import PropTypes from 'prop-types'


const ImageGrey = ({source, alternate, text , isSelected, height, width, onSelected, value}) => {
    return ( 
        <div className='container' onClick={onSelected()}>
            <img src={source} alt={alternate} style={isSelected? {filter: "grayscale(100%)"} : {filter: "grayscale(0%)"} } height ={height} width={width} />
            <figcaption>{text}</figcaption>
        </div>
     );
}
 ImageGrey.defualtProps = {
    isSelected: false,
    text: "No Text",
 }

 ImageGrey.propTypes = {
    // source: PropTypes.string,
    alternate: PropTypes.string,
    text: PropTypes.string,
    isSelected: PropTypes.bool,
    
 }
export default ImageGrey;
